import React from "react";
import { Container, Row, Col, Card, Button, Form } from "react-bootstrap";
import { Link } from "react-router-dom";
import blogImage from "../assets/Images/IMG_0765.JPG";

import { connect } from "react-redux";
import PropTypes from 'prop-tupes'

const JMsJournal = ({ journal: { _id, title, body, image, date, author } }) => {
  return (
    <React.Fragment>
      <Container>
        <Row xs={1} md={1} lg={1}>
          <Col>
            <Form>
              <Form.Control type="search" placeholder="search blog posts..." />
            </Form>
          </Col>
          <Col>
            <Card style={{ borderColor: "transparent " }}>
              <Card.Img variant="top" src={blogImage} />
              <Card.Body>
                <Card.Title>Style & Substance: Chelsea Boots</Card.Title>
                <Card.Text>
                  The English style boot thats both casual and somewhat formal.
                  The Chelsea boot first ...
                </Card.Text>
                <div className="d-grid gap-2">
                  <Button as={Link} to={`/jmsjournal/${_id}`} variant="danger">
                    Read More
                  </Button>
                </div>
              </Card.Body>
            </Card>
          </Col>
        </Row>
      </Container>
    </React.Fragment>
  );
};

JMsJournal.propTypes = {
  journal: PropTypes.object.isRequired,
}

export default connect(null,) (JMsJournal);
